query QueryRenderersCitySavedListQuery(
  $citySlug: String!
) {
  city(slug: $citySlug) {
    ...CitySavedList_city
  }
}

fragment CitySavedList_city on City {
  name
  sponsoredContent {
    shows(first: 20, after: "", sort: START_AT_ASC) {
      edges {
        node {
          id
          _id
          __id
          name
          status
          href
          is_followed
          exhibition_period
          cover_image {
            url
          }
          location {
            coordinates {
              lat
              lng
            }
            __id
          }
          type
          start_at
          end_at
          partner {
            __typename
            ... on Partner {
              name
              type
            }
            ... on ExternalPartner {
              name
              __id
            }
            ... on Node {
              __id
            }
          }
          __typename
        }
        cursor
      }
      pageInfo {
        endCursor
        hasNextPage
      }
    }
  }
}
